import { createRouter, createWebHistory } from "vue-router";

import Sidebar from "../components/sidebar/sideBar.vue";
import Pacientes from "../components/RegistroPaciente.vue";
import Examenes from "../components/ListaExamenes.vue";

const routes = [
  {
    path: "/",
    components: {
      default: Pacientes,
      sidebar: Sidebar,
    },
  },
  {
    path: "/pacientes",
    components: {
      default: Pacientes,
      sidebar: Sidebar,
    },
  },
  {
    path: "/examenes",
    components: {
      default: Examenes,
      sidebar: Sidebar,
    },
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
